import React from "react";
import ReactDOM from "react-dom/client";

const root = ReactDOM.createRoot(document.getElementById("root"));
let array1 = [1, 2, 3, 4, 5];
root.render(
  <>
    <h1>Hello, world!</h1>
    <div>
      {array1.map((item) => (
        <div key={item}>{item}</div>
      ))}
    </div>
  </>
);
